import React from 'react';
import { useSelector } from "react-redux";
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import { Button, Typography } from '@material-ui/core';
import ArrowForwardIcon from '@material-ui/icons/ArrowForward';

const StyledTableCell = withStyles((theme) => ({
  head: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  body: {
    fontSize: 14,
  },
}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
  root: {
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
    },
  },
}))(TableRow);

const useStyles = makeStyles({
    table: {
      minWidth: 300,
    },
  });

const handleExpand = () => {

};


function createData(index, firstName, mileage, form) {
  return { index, firstName, mileage, form };
}

export default function CustomizedTables({friends}) {
  const classes = useStyles();

  const getFriends = useSelector(state => state.friends);

  const rows = [];

  const count = 0;
  Array.from(getFriends).forEach((friend) => {
      console.log(friend);
      rows.push(createData(count, friend.public.firstName, friend.public.mileage, friend.public.form));
      count++;
  });

  return (
    <TableContainer component={Paper}>
      <Typography>Friends</Typography>
      <Table className={classes.table} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>First Name</StyledTableCell>
            <StyledTableCell align="center">Mileage</StyledTableCell>
            <StyledTableCell align="center">Form</StyledTableCell>
            <StyledTableCell align="center">More</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <StyledTableRow key={row.name}>
              <StyledTableCell component="th" scope="row">
                {row.firstName}
              </StyledTableCell>
              <StyledTableCell align="right">{row.mileage}</StyledTableCell>
              <StyledTableCell align="right">{row.form}</StyledTableCell>
              <StyledTableCell align="right"><Button onClick={handleExpand}><ArrowForwardIcon></ArrowForwardIcon></Button></StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
